import React from 'react'
import axios from 'axios';

function ExplorerView() {
    const [explorers, setExplorers] = useState([]);

    useEffect(() => {
        fetchExplorerList();
    }, []);

    const fetchExplorerList = async () => {
        try {
            const response = await axios.get('http://localhost:3001/api/v1/explorers/list');
            setExplorers(response.data.data);
        } catch (error) {
            console.error('Error fetching explorer list:', error);
        }
    };
  return (
    <div className="content-wrapper">
        <div className="container-xxl flex-grow-1 container-p-y">
            <div className="row">
                <div className="row mb-5">
                {explorers.map(explorer => (
                <div className="col-6">
                    <div className="card mb-3">
                    <div className="row g-0">
                        <div className="col-md-6">
                        <iframe 
                        src="https://www.youtube.com/embed/vOYgCuCXcv4?si=KOhr8G0tyJpSSPs6"
                        title="YouTube video player"
                        className="card-iframe"
                        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                        referrerpolicy="strict-origin-when-cross-origin"
                        allowFullScreen
                      ></iframe>
                        </div>
                        <div className="col-md-6">
                        <div className="card-body">
                            <h5 className="card-title">Card title</h5>
                            <p className="card-text">
                            This is a wider card with supporting text below as a natural lead-in to additional content.
                            This content is a little bit longer.
                            </p>
                        </div>
                        </div>
                    </div>
                    </div>
                </div>
                ))}
                </div>

            </div>
        </div>
    </div>
  )
}

export default ExplorerView
